import { Header } from './Header'
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';

export const AddProduct = () => {

  const [name, setName] = useState("");
  const [model, setModel] = useState("");
  const [image, setImage] = useState("");
  const [description, setDescription] = useState("");
  const [price, setPrice] = useState("");


  function addproduct() {

  }


  return (
    <div>
      <Header />

      <div className="col-md-6 offset-sm-3 border shadow mt-20">
        <h1>Add Products</h1>
        <Form>

          <Form.Group className="m-5" controlId="">
            <Form.Control type="text" placeholder="Device Name" value={name} />
          </Form.Group>

          <Form.Group className="m-5" controlId="formBasicLastname">
            <Form.Control type="text" placeholder="Model Number" value={model} />
          </Form.Group>

          <Form.Group className="m-5" controlId="formBasicEmail">
            Select Device Image
            <Form.Control type="file" value={image} />
          </Form.Group>

          <Form.Group className="m-5" controlId="formBasicLastname">
            <Form.Control type="text" placeholder="Price" value={price} />
          </Form.Group>

          <textarea rows={3} cols={80} placeholder='Product Description' value={description}></textarea><br />

          <Button variant="primary mb-3" onClick={addproduct}>
            Submit
          </Button>
        </Form>
      </div>
    </div>
  )
}
